Ad.ze MM Gambara/Piazzale Siena - Via Tommaso GulliProponiamo, a pochi minuti a piedi dalla MM Gambara, una soluzione immobiliare in stile loft, sita al piano terra di una palazzina risalente agli ’50 con servizio di portineria, di mq 50 c.a composta così come segue:PIANO TERRA: ingresso, cucina abitabile, zona living e bagno;
PIANO SOPPALCO: camera da letto, cabina armadio e lavanderia.
L’appartamento, luminoso ed arioso, è completamente ristrutturato a nuovo e verrà consegnato arredato.L’impianto di riscaldamento è CENTRALIZZATO ed è presente la predisposizione dell’aria condizionata.Completa la soluzione immobiliare una cantina di pertinenza ubicata al piano interrato.

